* **Application:** The script is using **Singularity** for containerization to run the R script.
* **Image:** The container image used is  `/scratch/mblab/chasem/software/llfs_rnaseq_latest.sif`. 
* **Resources:** The script requests specific computational resources using `SBATCH` directives. These include memory, nodes, cores, and time.
* **Environment:** The script sets the `R_LIBS` environment variable to point to the R library directory.
* **Script:**  The script executes an R script called `compile_compare_results.R` with the directory argument `$dir`.
* **Dependencies:** The script relies on `spack` for loading the singularityce package.
